import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class SearchDataService {

  constructor() { }
  searchText: string = ""
  @Output() searchData: EventEmitter<string> = new EventEmitter<string>()
  searchData(data: string) {
    this.searchText = data
    console.log(this.searchText)
  }
}
